import styles from "./../assets/components/Services.module.css";
import logoMongo from "./../assets/img/mongoDB-logo.png";
import logoSpring from "./../assets/img/spring-logo.png";
import logoSpark from "./../assets/img/spark-logo.png";

import Service from "./Service";

function Services(){
    return (
        <div>
            <div className={styles.title}>
                <p>Services</p>
            </div>
            <div className={styles.containerServices}>
                <Service 
                    nameService="Spring"
                    logo={logoSpring}
                    css={styles.spring}
                />
                <Service 
                    nameService="MongoDB"
                    logo={logoMongo}
                    css={styles.mongoDB}
                />
                <Service 
                    nameService="Servidor"
                />
                <Service 
                    nameService="Spark"
                    logo={logoSpark}
                    cdd={styles.spark}
                />
            </div>
        </div>
    );
}

export default Services;
